    "okefenokee-national-wildlife-refuge-annual-narrative-report-calendar-year-1996",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Okefenokee
    NWR and Banks Lake NWR outlines Refuge accomplishments during the 1996 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, manpower programs, volunteer programs, funding,
    and safety is given. Habitat management is also covered; subjects include wetlands,
    forests, fire management, pest control, and wilderness areas. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    scientific collections, animal control, and marking and banding. The public uses
    of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, computer
    systems, and energy conservation. Cooperative programs and items of interest are
    provided at the end.",nt"license_title": "License Not Specified",nt"extras":
